"use strict";

function f_gold(s, k) {
    s = s.split('').map(c => String(c.charCodeAt(0) - 'a'.charCodeAt(0) + 1)).join('');
    for (let i = 0; i < k; i++) {
        let t = 0;
        for (let j = 0; j < s.length; j++) {
            t += s.charCodeAt(j) - '0'.charCodeAt(0);
        }
        s = String(t);
    }
    return parseInt(s);
}
